	]]--
};
for i,o in pairs(ItemDB) do
	if o.minReputation then
		local faction = o.minReputation[1];
		if type(faction) == "string" then
			if faction == "Horde" then
				o.minReputation = nil;
				o.races = HORDE_ONLY;
			elseif faction == "Knight" then
				o.minReputation = nil;
			elseif not factions[faction] then
				print("WRONG REP TYPE", faction);
				factions[faction] = faction;
			else
				o.minReputation[1] = factions[faction];
			end
		end
	end
	
	-- This part only exists for us to find weird items.
	if o.otherRequirements then
		o.otherRequirements = nil;
	end
end